import { useNavigate } from "react-router-dom"

function LoginPage() {
    const movePage = useNavigate();

    function gomain(){
        movePage('/');
    }

return (
    <div className="login">
        로그인 페이지입니다.
        <button onClick={gomain}>메인으로 이동</button>
    </div>
)
}


export default LoginPage
